import React, {useState} from 'react'

import {Wrapper} from '../Styled';
import styled, {keyframes, css} from "styled-components";
import School from '@material-ui/icons/School';
import Construction from '@material-ui/icons/Build';
import Camera from '@material-ui/icons/CameraAlt';

import StarOutline from '@material-ui/icons/StarOutline';
import StarRate from '@material-ui/icons/StarRate';

const Container = styled(Wrapper)`
    min-height:70vh;
    justify-content:flex-start;
    align-items:center;
`

const Item = styled.div`
    width:100%;
    max-width:30em;
    margin:.2em;
`

const TopBar = styled.div`
    height:48px;

    background-color:var(--p-0);
    display:flex;
    align-items:center;

    border-radius:24px 24px 24px 24px;
    margin-bottom:1em;
`

const Title = styled.h5`
    color: var(--p-10);
    margin:0;
    padding-left:8px;
`

const Circle = styled.div`
    height:40px;
    width:40px;
    margin:4px;
    background-color:var(--s-3);
    border-radius:50%;
    display:flex;
    justify-content:center;
    align-items:center;
`

const Info = styled.div`
    max-width:100%;
    color: white;
    min-height:100px;
    margin: 0 0 0 24px;
    transform-origin:top;
    ${props => props.display && css`
        animation:${dot} 1s linear forwards;
    `}
    ${props => !props.display && css`
        display:none;
    `}
`
const Column = styled.div`
    max-width:100%;
    min-height:32px;
    padding:8px;
    display:flex;
    flex-direction:column;
    align-items:flex-start;
    justify-content:flex-start;
    position:relative;
    padding-bottom:32px;
`

const dot = keyframes`
    0% {
        opacity:0;
    }
    100% {
        opacity:1;
    }
`;

const ColumnTitle = styled.h6`
    opacity:0;
    color: var(--s-3);
    font-size:1em;
    position:absolute;
    top:-.5em;
    margin-left:8px;
    animation:${dot} .4s ${props => props.delay} ease-in-out forwards;
`

const Text = styled.p`
    opacity:0;
    color: var(--p-0);
    margin:0;
    padding:0;
    margin-left:16px;
    margin-top:12px; 
    animation:${dot} 1s 2s ease-in-out forwards;
`
const Time = styled.span`
    opacity:0;
